using namespace std;

class Solution {
public:
    int dietPlanPerformance(vector<int>& calories, int k, int lower, int upper) {
        int result =0;
        int temp=0;
        int n = calories.size();
        for(int i=0;i<=(n-k);i++){
            temp = 0;
            for(int j=0;j<k;j++){
                temp+=calories[i+j];
            }
            if(temp<lower)
                result-=1;
            if(temp>upper)
                result+=1;
        }
        return result;
    }
};

